import React from 'react';

const List = ({ items }) => {
  if (!Array.isArray(items)) {
    return <p>Nenhum item encontrado.</p>;
  }

  return (
    <div>
      <h2>Lista de Itens</h2>
      <ul>
        {items.map((item) => (
          <li key={item.id}>
            {item.name} - {item.email} - {item.phone}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default List;
